"use strict";(self.webpackChunkef_website_template=self.webpackChunkef_website_template||[]).push([[935],{3543:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/22-12-02-arbeiten-an-numtrip","metadata":{"permalink":"/EF-Informatik/22-12-02-arbeiten-an-numtrip","editUrl":"https://github.com/GraficPixelTDSM/EF-Informatik/tree/main/blog/22-12-02-arbeiten-an-numtrip.md","source":"@site/blog/22-12-02-arbeiten-an-numtrip.md","title":"arbeiten-an-numtrip","description":"Heute habe ich bei meinem Spiel einige Fehler korrigiert und einige unn\xf6tige Codeabschnitte gel\xf6scht.","date":"2022-12-23T15:38:51.000Z","formattedDate":"23. Dezember 2022","tags":[],"readingTime":0.17,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"nextItem":{"title":"Primzahlen berechnen","permalink":"/EF-Informatik/2022/09/03/Primzahlen berechnen"}},"content":"Heute habe ich bei meinem Spiel einige Fehler korrigiert und einige unn\xf6tige Codeabschnitte gel\xf6scht.\\nIch habe Pylint deinstallier, da es mir immer unn\xf6tige Fehler angezeigt hat.\\nIch hatte nirgends Schwierigkeiten und brauche keine Hilfe."},{"id":"/2022/09/03/Primzahlen berechnen","metadata":{"permalink":"/EF-Informatik/2022/09/03/Primzahlen berechnen","editUrl":"https://github.com/GraficPixelTDSM/EF-Informatik/tree/main/blog/2022-09-03-Primzahlen berechnen.md","source":"@site/blog/2022-09-03-Primzahlen berechnen.md","title":"Primzahlen berechnen","description":"Primzahlen berechnen","date":"2022-09-03T00:00:00.000Z","formattedDate":"3. September 2022","tags":[],"readingTime":0.395,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"arbeiten-an-numtrip","permalink":"/EF-Informatik/22-12-02-arbeiten-an-numtrip"},"nextItem":{"title":"Wiedereinstieg in Python nach einer l\xe4ngeren Pause","permalink":"/EF-Informatik/2022/08/26/wiedereinstieg-python"}},"content":"## Primzahlen berechnen \\nIch habe heute ein Programm geschrieben welches die Primzahlen von 1 bis zu einer beliebigen Zahl berechnet. W\xe4hrend der Berechnung werden die Primzahlen ausgegeben und in eine Liste zwischengespeichert.  \\nBei der Ausgabe w\xe4hrend der Berechnung steht auch noch der Fortschritt in Prozent und am Schluss wird noch angezeigt, wie lange die Berechnung gedauert hat (in Sekunden).  \\nDamit man einen guten \xdcberblick \xfcber die Primzahlen hat, werden diese am Schluss auch noch geb\xfcndelt in einer Liste ausgegeben."},{"id":"/2022/08/26/wiedereinstieg-python","metadata":{"permalink":"/EF-Informatik/2022/08/26/wiedereinstieg-python","editUrl":"https://github.com/GraficPixelTDSM/EF-Informatik/tree/main/blog/2022-08-26-wiedereinstieg-python.md","source":"@site/blog/2022-08-26-wiedereinstieg-python.md","title":"Wiedereinstieg in Python nach einer l\xe4ngeren Pause","description":"Mein Wiedereinstieg in Python war nicht einmal so schwierig. Ich wusste noch die meisten Sachen, musste aber trotzdem ein paar mal spicken.","date":"2022-08-26T00:00:00.000Z","formattedDate":"26. August 2022","tags":[],"readingTime":0.67,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"Primzahlen berechnen","permalink":"/EF-Informatik/2022/09/03/Primzahlen berechnen"}},"content":"![](./images/OIP.jpg)\\n\\nMein Wiedereinstieg in Python war nicht einmal so schwierig. Ich wusste noch die meisten Sachen, musste aber trotzdem ein paar mal spicken.   \\n\\nIch habe mit turtle angefangen. Dort gibt es Befehle wie `forward()`, `left()`, `right()` usw. welche mir im Kopf geblieben sind. Andere Befehle wie `penup()` oder `pencolor()` wusste ich z.B. nicht mehr.  \\n\\nEs ist mir nicht nur einmal passiert, dass ich `rigth()` anstelle von `right()` geschrieben habe. Dann habe ich lange nach dem Fehler gesucht und als ich ihn endlich gefunden habe, kam ein verwundertes \\"Ooooh\\".\\n\\nDanach ging es darum schleifen zu machen, damit man einzelne Codeabschnitte nicht hundert mal wiederholen muss, aber ich habe schon Schleifen gemacht, bevor es \xfcberhaupt eingef\xfchrt wurde.  \\n\\nZu guter letzt, war es die Aufgabe, Fehler in einem Code zu finde. das fiel mir aber auch leicht."}]}')}}]);